import React from 'react'

const Project = props => {

    const {number, title, technos, description} = props.project;

    return (
        <div className="pieces-slider__slide">
            <img className="pieces-slider__image" src="img/ricardo-gomez-angel-381749.jpg" alt={title}/>
            <div className="pieces-slider__text">{title}</div>
        </div>
    )
}

export default Project;
